import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import _ from 'lodash';

class Alert extends Component {
  componentDidMount() {
    this.okRef.focus();
  }
  render() {
    const res = _.isFunction(this.props.message)
      ? this.props.message(this.props.close)
      : this.props.message;
    return (
      <div className="modal" tabindex="-1" role="dialog" style={{ display: 'block' }}>
        <div className="modal-dialog" role="document">
          <div className="modal-content">
            <div className="modal-header">
              <button
                type="button"
                className="close"
                data-dismiss="modal"
                onClick={this.props.close}
                aria-label="Close">
                <span aria-hidden="true">&times;</span>
              </button>
              <h4 className="modal-title">{this.props.title ? this.props.title : 'Alert'}</h4>
            </div>
            <div className="modal-body">
              {_.isString(res) && <p>{res}</p>}
              {!_.isString(res) && !_.isFunction(res) && res}
              {!_.isString(res) && _.isFunction(res) && res(this.props.close)}
            </div>
            <div className="modal-footer">
              {this.props.linkOpt && (
                <a
                  data-dismiss="modal"
                  href={this.props.linkOpt.to}
                  className="btn btn-default"
                  onClick={this.props.close}>
                  {this.props.linkOpt.title}
                </a>
              )}
              <button
                ref={(r) => (this.okRef = r)}
                type="button"
                className="btn btn-primary"
                onClick={this.props.close}>
                Close
              </button>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

class Confirm extends Component {
  componentDidMount() {
    document.body.addEventListener('keydown', this.defaultButton);
    this.okRef.focus();
  }
  render() {
    return (
      <div className="modal" tabindex="-1" role="dialog" style={{ display: 'block' }}>
        <div className="modal-dialog" role="document">
          <div className="modal-content">
            <div className="modal-header">
              <button
                type="button"
                className="close"
                data-dismiss="modal"
                onClick={this.props.cancel}
                aria-label="Close">
                <span aria-hidden="true">&times;</span>
              </button>
              <h4 className="modal-title">{this.props.title ? this.props.title : 'Confirm'}</h4>
            </div>
            <div className="modal-body">
              <p>{this.props.message}</p>
            </div>
            <div className="modal-footer">
              <button
                ref={(r) => (this.cancelRef = r)}
                type="button"
                className="btn btn-danger"
                onClick={this.props.cancel}>
                Cancel
              </button>
              <button
                ref={(r) => (this.okRef = r)}
                type="button"
                className="btn btn-success"
                onClick={this.props.ok}>
                Ok
              </button>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

class Prompt extends Component {
  state = {
    text: this.props.value || '',
  };
  componentDidMount() {
    this.okRef.focus();
    if (this.ref) {
      this.ref.focus();
    }
  }
  render() {
    return (
      <div className="modal" tabindex="-1" role="dialog" style={{ display: 'block' }}>
        <div className="modal-dialog" role="document">
          <div className="modal-content">
            <div className="modal-header">
              <button
                type="button"
                className="close"
                data-dismiss="modal"
                onClick={this.props.cancel}
                aria-label="Close">
                <span aria-hidden="true">&times;</span>
              </button>
              <h4 className="modal-title">{this.props.title ? this.props.title : 'Prompt'}</h4>
            </div>
            <div className="modal-body">
              <p>{this.props.message}</p>
              {!this.props.textarea && (
                <input
                  type={this.props.type || 'text'}
                  className="form-control"
                  value={this.state.text}
                  ref={(r) => (this.ref = r)}
                  onChange={(e) => this.setState({ text: e.target.value })}
                />
              )}
              {this.props.textarea && (
                <textarea
                  className="form-control"
                  value={this.state.text}
                  ref={(r) => (this.ref = r)}
                  rows={this.props.rows || 5}
                  onChange={(e) => this.setState({ text: e.target.value })}
                />
              )}
            </div>
            <div className="modal-footer">
              <button type="button" className="btn btn-danger" onClick={this.props.cancel}>
                Cancel
              </button>
              <button
                type="button"
                className="btn btn-success"
                ref={(r) => (this.okRef = r)}
                onClick={(e) => this.props.ok(this.state.text)}>
                Ok
              </button>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

class Popup extends Component {
  render() {
    return (
      <div
        className="modal"
        tabindex="-1"
        role="dialog"
        style={{ display: 'block', ...this.props.style }}>
        <div className="modal-dialog" role="document">
          <div className="modal-content">
            <div className="modal-header">
              <button
                type="button"
                className="close"
                data-dismiss="modal"
                onClick={this.props.cancel}
                aria-label="Close">
                <span aria-hidden="true">&times;</span>
              </button>
              <h4 className="modal-title">{this.props.title}</h4>
            </div>
            {this.props.body(this.props.ok, this.props.cancel)}
          </div>
        </div>
      </div>
    );
  }
}

export function registerAlert() {
  window.oldAlert = window.alert;
  if (!document.getElementById('otoroshi-alerts-container')) {
    const div = document.createElement('div');
    div.setAttribute('id', 'otoroshi-alerts-container');
    document.body.appendChild(div);
  }
